var printDimensions = function(pre, extra){
	if( ! document.getElementById("debug") ) return;
	document.getElementById("debug").insertAdjacentHTML("beforeend", "<br>" + pre
		+ " W:" + window.innerWidth + "x" + window.innerHeight
