		+ extra
	);
}

if (document.documentElement.className.indexOf('android') !== -1) {
  var windowHeight = function(){ return window.outerHeight; }
  var windowWidth = function(){ return window.outerWidth; }
} else {
  var windowHeight = function(){ return window.innerHeight; }
  var windowWidth = function(){ return window.innerWidth; }
}

var encodeHTML = function() { document.getElementsByTagName("body")[0].insertAdjacentHTML("beforeend", '<div style="white-space:pre;position:fixed;top:0;left:0;width:100%;height:100%;z-index:999;text-align:left;font-size:5px;color:#fff;background-color: rgba(0,0,0,0.50);font-family:Monaco,monospace;">' +document.documentElement.outerHTML.replace(/</g,"&lt;").replace(/>/g,"&gt;")+'</div>'); }

function setStyle(selector, propName, propVal) { [].forEach.call(document.querySelectorAll(selector), function (el) { el.style[propName] = propVal; }); }

function currentDeckMessages() {

	var article = document.getElementsByTagName("article")[0];
	setStyle('.subdeck', 'display', 'none');
	var subdeck = article.dataset.deck.replace(/^General(?:::Language)?::((?:(?!::).)*)(?:::.*)?/, '$1');
	if(subdeck === ''){ setStyle('.subdeck.Other', 'display', ''); }
	else { setStyle('.subdeck.' + subdeck, 'display', ''); }

	var section = document.getElementsByTagName("section");
	for(var i = 0; i < section.length; i++){
		// replace hyphens not inside tags (properties) with nonbreaking hyphens
		section[i].innerHTML = section[i].innerHTML.replace(/-(?![^<]*>)/g, '\u2011'); // changed /-(?![^<]*>|[^<>]*<\/)/g because targeting within tags too
	}

	var body = document.getElementsByTagName("body")[0];
	var article = document.getElementsByTagName("article")[0];

	// var bodyFontSize = parseInt(document.defaultView.getComputedStyle(body).getPropertyValue('font-size'));
	var bodyFontSizeMin = 25;
  if (document.documentElement.className.indexOf('android') !== -1) { bodyFontSizeMin = 14; }
	var bodyFontSizeMax = 725;
	var bodyFontSize = bodyFontSizeMin;

	function setBodyFontSize(int){ body.style.fontSize = int + 'px'; }

	var step = 350;
	while( step >= 0.1 ){
		do {
			bodyFontSize += step;
			setBodyFontSize(bodyFontSize);
			printDimensions("i ", " fS:" + bodyFontSize + " step:" + step);
		} while( windowWidth() >= body.scrollWidth && windowHeight() >= body.scrollHeight && bodyFontSize <= bodyFontSizeMax && bodyFontSize >= bodyFontSizeMin );
		bodyFontSize -= step+3;
		if( bodyFontSize < bodyFontSizeMin ){ bodyFontSize = bodyFontSizeMin; }
		// step = Math.floor(step / 4);
		step = step / 4;
		setBodyFontSize(bodyFontSizeMin);
		setBodyFontSize(bodyFontSize);
		printDimensions("o ", " fS:" + bodyFontSize);
	}

}

function playSound() {
	var article = document.getElementsByTagName("article")[0];
	var subdeck = article.dataset.deck.replace(/^General(?:::Language)?::((?:(?!::).)*)(?:::.*)?/, '$1');
	if(subdeck === 'English'){
		var a = new Audio(document.getElementById("audio"));
		a.play();
	}
}

setInterval(function(){ resize();  }, 500);
